import Navbar from "react-bootstrap/Navbar";
import { Nav } from "react-bootstrap";

function Myheader() {
  return (
    <>
      <Navbar variant="dark" bg="dark" className="w-100">
        <Navbar.Brand href="#home">LEONARDO ANTONELLI â€¢ PORTFOLIO</Navbar.Brand>
        <Nav className="ms-auto">
          <Nav.Link href="#home" variant="light" className="light">
            Projects
          </Nav.Link>
          <Nav.Link href="#home" variant="light" className="light">
            About me
          </Nav.Link>
        </Nav>
      </Navbar>
      <hr className="light mt-0 pt-0" />
    </>
  );
}

export default Myheader;
